INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DWTX', 'STOCK', 'Dogwood Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Dogwood Therapeutics, Inc. is a development-stage biopharmaceutical company focused on developing new medicines to treat pain and fatigue-related disorders. The Companys research pipeline includes two separate mechanistic platforms with a non-opioid analgesic program and an antiviral program. The proprietary, non-opioid, Nav 1.7 analgesic program is centered on its lead development candidate, Halneuron, which is a specific voltage-gated sodium channel modulator, a mechanism known to be effective for reducing pain transmission. In clinical studies, Halneuron treatment has demonstrated pain reduction in pain related to general cancer and in pain related to chronic chemotherapy-induced neuropathic pain (CINP). The Companys antiviral program includes IMC-1 and IMC-2, which are fixed-dose combinations of nucleoside analog, anti-herpes antivirals and the anti-inflammatory agent celecoxib for the treatment of fibromyalgia (FM) and Long-COVID (LC).', 'Alpharetta, GA, United States', 12);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BFST', 'STOCK', 'Business First Bancshares, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Business First Bancshares, Inc. is a financial holding company. The Company operates through its banking subsidiary, b1BANK (the Bank). The Bank is a Louisiana state banking association and community-based financial institution that offers a full array of banking products and services. It operates throughout the state of Louisiana, in the Dallas/Fort Worth metroplex and Houston, from a network of banking centers and loan production offices. The Bank offers products, such as checking, savings and money market accounts, certificates of deposit, commercial and consumer loans, mortgage loans, real estate loans, and other installment and term loans. In addition, it offers its customers wealth management products, drive-through banking facilities, ATMs, night depository, personalized checks, credit cards, debit cards, Internet banking, electronic funds transfers through ACH services, domestic and foreign wire transfers, travelers checks, cash management, vault services, and others.', 'Baton Rouge, LA, United States', 849);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('TXMD', 'STOCK', 'TherapeuticsMD, Inc.', 'NMS', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'TherapeuticsMD, Inc. is a pharmaceutical royalty company, which primarily collects royalties from its licensees. It receives royalties on products licensed to pharmaceutical organizations that possess commercial capabilities in the relevant territories. It granted a license to commercialize IMVEXXY, BIJUVA, and prescription prenatal vitamin products sold under the BocaGreenMD and vitaMedMD brands and assigned its exclusive license to commercialize ANNOVERA to Mayne Pharma. IMVEXXY (estradiol vaginal inserts) pharmaceutical product is for the treatment of moderate-to-severe dyspareunia. BIJUVA pharmaceutical product is a Food and Drug Administration (FDA)-approved bioidentical hormone therapy combination of estradiol and progesterone in a single, oral capsule for the treatment of moderate-to-severe vasomotor symptoms due to menopause in women with a uterus. ANNOVERA pharmaceutical product is a one-year ring-shaped contraceptive vaginal system (CVS).', 'Boca Raton, FL, United States', 1);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CALC', 'STOCK', 'CalciMedica, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'CalciMedica, Inc. is a clinical-stage biopharmaceutical company. The Company focused on developing novel calcium release-activated calcium (CRAC) channel inhibition therapies for inflammatory and immunologic diseases. The Company''s technology targets the inhibition of CRAC channels to modulate the immune response and protect against tissue cell injury. Its lead product candidate is Auxora, a potent and selective intravenous formulated small molecule CRAC channel inhibitor containing the active compound zegocractin (formerly referred to as CM4620) that, in animal models, reduced acute epithelial and/or endothelial cell injury and inflammation in organs, such as the pancreas, lungs and kidneys. The Company is conducting a Phase IIb trial (called CARPO) for acute pancreatitis (AP) with systemic inflammatory response syndrome (SIRS), as well as supporting the ongoing Phase I/II asparaginase-induced pancreatic toxicity (AIPT) study (called CRSPA).', 'La Jolla, CA, United States', 15);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BWG', 'STOCK', 'Legg Mason BW Global Income Opportunities Fund Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Legg Mason BW Global Income Opportunities Fund Inc. is a closed ended fixed income mutual fund launched and managed by Legg Mason Partners Fund Advisor, LLC. The fund is co-managed by Brandywine Global Investment Management, LLC. It invests in fixed income markets. The fund employs fundamental analysis to create its portfolio. Legg Mason BW Global Income Opportunities Fund Inc. was formed on March 28, 2012 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EQBK', 'STOCK', 'Equity Bancshares, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Equity Bancshares, Inc. is the holding company for Equity Bank (the Bank). The Bank is engaged in offering a full range of financial solutions, including commercial loans, consumer banking, mortgage loans, trust and wealth management services and treasury management services, while delivering the relationship-based customer service of a community bank. It operates a network of over 82 branches located in Arkansas, Kansas, Missouri and Oklahoma. The Banks operations involve the delivery of loans and deposit products to its customers. It provides a variety of loans, such as commercial and industrial loans, commercial real estate loans, 1-4 family residential mortgages, agricultural loans, and consumer loans. It offers a full suite of online banking solutions including access to account balances, online transfers, online bill payment and electronic delivery of customer statements, mobile banking solutions for iPhone and Android phones, including remote check deposit with mobile bill pay.', 'Wichita, KS, United States', 810);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CELZ', 'STOCK', 'Creative Medical Technology Holdings, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Creative Medical Technology Holdings, Inc. is a commercial stage biotechnology company dedicated to the advancement of identifying and translating novel biological therapeutics in the fields of immunotherapy, endocrinology, urology, neurology and orthopedics. The Company conducts substantially all of its commercial operations through its subsidiary, Creative Medical Technologies, Inc. Its products include AlloStem (CELZ-201-DDT) - allogenic human perinatal tissue derived cell program (clinical phase), ImmCelz (CELZ-100) - personalized supercharged immune therapy platform (pre-clinical trials), Type I Diabetes (CELZ-201 CREATE-1) - type I diabetes, Allostemspine Chronic Lower Back Pain (CELZ 201 ADAPT), Alova, CaverStem - erectile dysfunction treatment, FemCelz - female sexual function treatment, StemSpine - regenerative stem cell procedure for the treatment of degenerative disc disease (clinical trials), and OvaStem - stem cell therapy for premature ovarian failure.', 'Phoenix, AZ, United States', 4);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTY', 'STOCK', 'Century Casinos, Inc.', 'NCM', 'Consumer Cyclical', 'Resorts & Casinos', 'Century Casinos, Inc. is a casino entertainment company. The Company operates gaming establishments, as well as related lodging, restaurants, horse racing, (including off-track betting) and entertainment facilities primarily in North America. The Companys operating segments in the United States, include East, the Mountaineer Casino, Resort & Races in New Cumberland, West Virginia and Rocky Gap Casino, Resort & Golf in Flintstone, Maryland; Midwest, the Century Casinos in Cape Girardeau and Caruthersville, Missouri, and Century Casino & Hotels in Cripple Creek and Central City, Colorado; and West, the Nugget Casino Resort, in Reno/Sparks, Nevada. In Canada, the Company operates Century Casino & Hotel in Edmonton, the Century Casino in St. Albert, Century Mile Racetrack and Casino in Edmonton and Century Downs Racetrack and Casino in Calgary. In Poland, the Company operates approximately six casinos through the Companys subsidiary Casinos Poland Ltd.', 'Colorado Springs, CO, United States', 3181);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVSD', 'STOCK', 'Eaton Vance Short Duration Income ETF', 'NGM', NULL, NULL, 'Everside Health, LLC is a direct primary care and mental care provider in United States. The Company operates in approximately 385 plus health centers in 34 states. It is a patient-focused and technology-driven company that integrates primary, mental, and occupational healthcare into one solution. The Companys complete care solution technology-driven primary and preventive care includes services, such as mental healthcare, including counseling on non-opioid options-chronic condition management, and pharmaceutical services. Its technology platform, Everside 360 aggregates patient data from multiple sources and leverages predictive analytics to present gaps in care to its care teams. Its Everside Everywhere a proprietary digital health application designed to promote member engagement and self-management of health enables patients to schedule in-person and virtual visits, message providers, access records, and request prescription refills through portal and mobile application.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BME', 'STOCK', 'BlackRock Health Sciences Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Health Sciences Trust is a closed-ended equity mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating in the health sciences and related sectors, which include businesses involved in researching, developing, producing, distributing or delivering medical, dental, optical, pharmaceutical or biotechnology products, supplies, equipment, or services. It also invests through equity derivatives, with an emphasis on option writing. The fund benchmarks the performance of its portfolio against the Russell 3000 Healthcare Index. BlackRock Health Sciences Trust was formed on March 31, 2005 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLNG', 'STOCK', 'Dynagas LNG Partners LP', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Dynagas LNG Partners LP, through its subsidiaries, operates in the seaborne transportation industry in Greece and internationally. It owns and operates liquefied natural gas (LNG) carriers. The company''s fleet consists of six LNG carriers with an aggregate carrying capacity of approximately 914,000 cubic meters. Dynagas GP LLC serves as the general partner of Dynagas LNG Partners LP. The company was incorporated in 2013 and is headquartered in Athens, Greece.', 'Athens, , Greece', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUI', 'STOCK', 'BlackRock Utilities, Infrastructure & Power Opportunities Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Utility, Infrastructure & Power Opportunities Trust is a closed ended equity mutual fund launched by BlackRock, Inc. The fund is managed by BlackRock Advisors, LLC. It invests in public equity markets across the globe. The fund seeks to invest in stocks of companies operating in the utilities and infrastructure sectors. It invests in stocks of companies across diversified market capitalizations. The fund also invests through derivatives, with an emphasis on option writing. The fund was formerly known as BlackRock Utility and Infrastructure Trust. BlackRock Utility, Infrastructure & Power Opportunities Trust was formed on November 22, 2011 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AVR', 'STOCK', 'Anteris Technologies Global Corp.', 'NGM', 'Healthcare', 'Medical Instruments & Supplies', 'Anteris Technologies Global Corp. is a structural heart company, which is engaged in providing cardiac care by science-driven and measurable advancements to restore heart valve patients to healthy function. Its lead asset, the DurAVR Transcatheter Heart Valve System (THV) consists of a single-piece, biomimetic valve made with its ADAPT tissue-enhancing technology and deployed with its ComASUR balloon-expandable delivery system. DurAVR THV is a novel transcatheter aortic valve for the treatment of aortic stenosis that is shaped to mimic the performance of a healthy human aortic valve. DurAVR THVs single-piece design mimics the native anatomy of a human aortic valve, as compared to traditional three-piece aortic valves. The Companys ADAPT is its proprietary anti-calcification tissue shaping technology that is designed to reengineer xenograft tissue into a pure, single-piece collagen bioscaffold. Its ComASUR delivery system is a physician-developed balloon expandable delivery system.', 'Toowong, QLD, Australia', 136);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMWD', 'STOCK', 'American Woodmark Corporation', 'NMS', 'Consumer Cyclical', 'Furnishings, Fixtures & Appliances', 'American Woodmark Corporation is a cabinet manufacturer. The Company manufactures and distributes kitchen, bath and home organization products for the remodeling and new home construction markets. The Company''s cabinetry products are available in a variety of designs, finishes and finish colors and door styles. Its kitchen cabinetry and bath cabinetry products are offered across all product categories (made-to-order and stock) while its home organization products are exclusively stock products. Its products are sold on a national basis across the United States to the remodeling and new home construction markets. It services these markets through three primary channels: home centers, builders, and independent dealers and distributors. It operates approximately 18 manufacturing facilities in the United States and Mexico and eight primary service centers, and one distribution center located throughout the United States. Its brands include waypoint living spaces,1951 Cabinetry and others.', 'Winchester, VA, United States', 7800);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FGF', 'STOCK', 'Fundamental Global Inc.', 'NGM', 'Financial Services', 'Insurance - Diversified', 'Fundamental Global Inc. and its subsidiaries engage in diverse business activities including reinsurance, asset management, merchant banking, and managed services. The Companys segments include reinsurance, merchant banking, and managed services. The reinsurance segment consists of the operations of its Cayman Islands-based reinsurance subsidiary, FG Reinsurance Ltd (FGRe). The merchant banking segment includes its holdings made outside of reinsurance operations. Its merchant banking services include various strategic, administrative, and regulatory support services to newly formed special purpose acquisition companies (its SPAC platform). In addition, its merchant banking division has facilitated the launch of several new companies, including FG Communities, Inc., a self-managed real estate company. Its managed services segment includes Strong Technical Services, Inc., which provides comprehensive managed service offerings to cinema operators and entertainment venues nationwide.', 'Mooresville, NC, United States', 130);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CHR', 'STOCK', 'Cheer Holding, Inc.', 'NCM', 'Communication Services', 'Advertising Agencies', 'Cheer Holding Inc, formerly Glory Star New Media Group Holdings Ltd, is a China-based company mainly engaged in the provision of next-generation mobile internet infrastructure and platform services. The Company is dedicated to building a digital ecosystem that integrates platforms, applications, technology, and industry into a cohesive system, thereby creating a new, open business environment for web3.0 that leverages artificial intelligence (AI) technology. The Company''s portfolio includes a wide range of products and services, such as Polaris Intelligent Cloud, CHEERS Telepathy, CHEERS Open Platform, CHEERS Video, CHEERS e-Mall, CheerReal, CheerCar, CheerChat, CHEERS Fresh Group-Buying E-commerce Platform, Digital Innovation Research Institute, CHEERS Livestreaming, variety show series, IP short video matrix and more.', 'Beijing, , China', 122);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNXN', 'STOCK', 'PC Connection, Inc.', 'NMS', 'Technology', 'Electronics & Computer Distribution', 'PC Connection, Inc. delivers custom-configured computer systems overnight from its ISO 9001:2015-certified technical configuration lab at its distribution center in Wilmington, Ohio. The Company provides a range of information technology (IT) solutions, from the desktop to the cloud, including computer systems, data center solutions, software and peripheral equipment, networking communication, and other products and accessories, which the Company purchases from manufacturers, distributors and other suppliers. The Company operates through three segments: Connection Enterprise Solutions, Connection Business Solutions and Connection Public Sector Solutions. Connection Enterprise Solutions segment is engaged in serving large enterprise customers. The Connection Business Solutions segment is engaged in serving small to medium-sized businesses (SMBs). Connection Public Sector Solutions segment is engaged in serving federal, state, and local government and educational institutions.', 'Merrimack, NH, United States', 2580);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EEMA', 'STOCK', 'iShares MSCI Emerging Markets Asia ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its assets in the component securities of the underlying index and in investments that have economic characteristics that are substantially identical to the component securities of the underlying index. The underlying index is designed to measure equity market performance in the emerging market countries of Asia. The underlying index includes large- and mid-capitalization companies and may change over time.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTO', 'STOCK', 'John Hancock Financial Opportunities Fund', 'NYQ', 'Financial Services', 'Asset Management', 'John Hancock Financial Opportunities Fund is a closed-ended equity mutual fund launched and managed by John Hancock Investment Management LLC. It is co-managed by John Hancock Asset Management. The fund invests in the public equity markets across the globe. It seeks to invest in the stocks of companies operating across the financial services sector. The fund invests in companies across all market capitalizations. It benchmarks the performance of its portfolio against the S&P Composite 1500 Banks Index. The fund was formerly known as John Hancock Bank and Thrift Opportunity Fund. John Hancock Financial Opportunities Fund was formed on August 23, 1994 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HSII', 'STOCK', 'Heidrick & Struggles International, Inc.', 'NMS', 'Industrials', 'Staffing & Employment Services', 'Heidrick & Struggles International, Inc. is an advisory firm providing executive search, consulting and on-demand talent services to businesses and business leaders worldwide. It provides its services to a range of clients through the expertise of over 500 consultants located in cities around the world. Its service offerings include Executive Search, On-Demand Talent and Heidrick Consulting. Executive search firms are generally separated into two categories: retained search and contingency search. Its on-demand services provide clients with seamless on-demand access to top independent talent, including professionals with deep industry and functional expertise for interim leadership roles and critical, project-based initiatives. Heidrick Consulting offers its clients impactful approaches to human capital development through a myriad of solutions, ranging from leadership assessment and development, team and organization acceleration, diversity and inclusion advisory services and others.', 'Chicago, IL, United States', 2217);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMCM', 'STOCK', 'Cheetah Mobile Inc.', 'NYQ', 'Communication Services', 'Internet Content & Information', 'Cheetah Mobile Inc. is a holding company. The Company and its consolidated subsidiaries, variable interest entities (VIEs) and a VIE''s subsidiary are engaged in the provision of online marketing services, Internet value-added services, and Internet security services and others. The Company operates a platform that offers mobile and personal computer (PC) applications for its users and global content promotional channels for its customers, both of which are powered by its cloud-based data analytics engines. For its users, its diversified suite of applications optimizes mobile and PC Internet system performance, and provides real time protection against known and unknown security threats. Its data analytics engines perform real time analysis of mobile applications, program files and Websites on their devices for behavior that may impair system performance or impose security risks.', 'Beijing, , China', 934);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSJS', 'STOCK', 'Invesco BulletShares 2028 High Yield Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The index seeks to measure the performance of a portfolio of U.S. dollar-denominated high yield corporate bonds (commonly known as "junk bonds") with maturities or, in some cases, "effective maturities" in the year 2028. It does not purchase all of the securities in the index; instead, the fund utilizes a "sampling" methodology to seek to achieve its investment objective.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BALY', 'STOCK', 'Bally''s Corporation', 'NYQ', 'Consumer Cyclical', 'Resorts & Casinos', 'Bally''s Corporation is a global casino-entertainment company with an omnichannel presence. The Company owns and operates 19 casinos across 11 states, along with a golf course in New York and a horse racetrack in Colorado and holds OSB licenses in 13 jurisdictions in North America. The Company owns Aspers Casino in Newcastle, United Kingdom. It also owns Bally Bet, a sports betting platform; Bally Casino, an iCasino platform; Ballys Interactive International division (formerly Gamesys Group), a global interactive gaming operator; and a significant economic stake in Intralot S.A., a global lottery management and services business. The Companys casino operations include approximately 17,300 slot machines, 595 table games, and 4,165 hotel rooms. The Company also has rights to developable land in Las Vegas at the site of the former Tropicana Las Vegas. The Companys segments include Casinos & Resorts, International Interactive, and North America Interactive.', 'Providence, RI, United States', 10000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('LINK', 'STOCK', 'Interlink Electronics, Inc.', 'NCM', 'Technology', 'Electronic Components', 'Interlink Electronics, Inc. is a provider of sensors and printed electronics used in Human-Machine Interface (HMI) devices and Internet-of-Things (IoT) solutions. The Company designs, develops, manufactures and sells a range of force-sensing technologies that incorporate its materials technology, firmware and software into a portfolio of standard products and custom solutions. The application of its HMI technology platforms includes vehicle entry, vehicle multi-media control interface, rugged touch controls, presence detection, collision detection, speed and torque controls, pressure mapping, biological monitoring, and others. The Company also offers electrochemical gas-sensing technology products and solutions for industry, community, health and home settings.', 'Fremont, CA, United States', 102);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWCO', 'STOCK', 'Consolidated Water Co. Ltd.', 'NMS', 'Utilities', 'Utilities - Regulated Water', 'Consolidated Water Co. Ltd. is a Cayman Islands-based company, which engages in the provision of design, build, and operate solutions for water treatment. The Company manufactures components for water treatment equipment and offers distribution, design, installation, and management services. It has five reportable segments, namely retail, bulk, services, manufacturing, and corporate. The retail segment operates the water utility for the Seven-Mile Beach and West Bay areas. The bulk segment supplies potable water to government utilities. The services segment designs, constructs and sells water infrastructure and provides management and operating services to third parties. The manufacturing segment manufactures and services a wide range of custom and specialized water-related products applicable to commercial, municipal, and industrial water production, supply, and treatment. The corporate segment consists of various activities of a general and administrative nature.', 'Grand Cayman, , Cayman Islands', 307);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EM', 'STOCK', 'Smart Share Global Limited', 'NCM', 'Consumer Cyclical', 'Personal Services', 'Smart Share Global Ltd is a China-based consumer tech company principally providing mobile device charging service through an online and offline network. The Company provides services through its power banks, placed in Points of Interest (POIs) operated by its location partners, such as entertainment venues, restaurants, shopping centers, hotels, transportation hubs and public spaces. Users can start using its products by either spotting its cabinets at one of its POIs, or find its cabinet locations through its mini programs. Its mini programs show users a map view with its cabinets'' locations.', 'Shanghai, , China', 3656);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VPV', 'STOCK', 'Invesco Pennsylvania Value Municipal Income Trust', 'NYQ', 'Financial Services', 'Asset Management', 'Invesco Pennsylvania Value Municipal Income Trust is a closed-ended fixed income mutual fund launched by Invesco Ltd. The fund is co-managed by Invesco Advisers, Inc., INVESCO Asset Management (Japan) Limited, INVESCO Asset Management Deutschland GmbH, INVESCO Asset Management Limited, Invesco Canada Ltd., Invesco Hong Kong Limited, and INVESCO Senior Secured Management, Inc. It invests in the fixed income markets of the United States. The fund primarily invests in investment grade Pennsylvania municipal securities which include municipal bonds, municipal notes, municipal commercial paper, and lease obligations. It employs fundamental analysis with bottom-up security selection approach to create its portfolio. The fund was formerly known as Invesco Van Kampen Pennsylvania Value Municipal Income Trust. Invesco Pennsylvania Value Municipal Income Trust was formed on April 30, 1993 and is domiciled in the United States.', 'Atlanta, GA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLX', 'STOCK', 'Banco Latinoamericano de Comercio Exterior, S. A.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Banco Latinoamericano de Comercio Exterior, S.A. (the Bank) is a specialized multinational bank. The Bank is established to support the financing of trade and economic integration in Latin America and the Caribbean. The Company operates in two segments: Commercial and Treasury. The Bank''s Commercial segment incorporates all of the Bank''s financial intermediation and fees generated by the commercial portfolio activities, such as origination of bilateral and syndicated credits, short- and medium-term loans, acceptances and contingent credits. The Bank''s Treasury segment incorporates deposits in banks and all of the Bank''s trading assets, securities available-for-sale and held-to-maturity, and the balance of the investment funds. The Bank serves a range of sectors, including oil and gas, agribusiness, food processing and manufacturing. Its products and services are categorized into three main areas: Financial Intermediation Business, Structuring and Syndications Business and Treasury.', 'Panama City, , Panama', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEAT', 'STOCK', 'HeartBeam, Inc.', 'NCM', 'Healthcare', 'Health Information Services', 'HeartBeam, Inc. is a cardiac technology company. The Company focuses on developing and commercializing higher resolution ambulatory Electrocardiogram (ECG) solutions that enable the detection and monitoring of cardiac disease both inside and outside a healthcare facility setting. It is engaged in the development of higher resolution ECG solutions is achieved through the development of the Companys proprietary and patented electrocardiography technology platform. It is developing three-dimensional (3D) representations of cardiac electrical activity by displaying the spatial locations of ECG waveforms. It is developing its own product, the HeartBeam System. The HeartBeam System comprises a credit card sized 12-lead output electrocardiogram device, a patient application, a physician portal, and powerful cloud-based algorithms. The core technology consists of a series of patented inventions that allow it to capture the hearts electrical activity from three distinct directions.', 'Santa Clara, CA, United States', 19);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGX', 'STOCK', 'Blackstone Long-Short Credit Income Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Blackstone Long-Short Credit Income Fund is a close-ended fixed income mutual fund launched by The Blackstone Group LP. The fund is managed by GSO / Blackstone Debt Funds Management LLC. It takes both long and short positions to invest in the fixed income markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in loans and fixed-income instruments of corporate issuers, including first and second lien secured loans and high-yield corporate debt securities of varying maturities. The fund seeks to invest in securities rated below investment grade. It employs fundamental analysis using a research-driven credit approach to create its portfolio. The fund benchmarks the performance of its portfolio against a composite index comprised of 70% S&P/LSTA Leveraged Loan Index and 30% Barclays US High Yield Index. Blackstone Long-Short Credit Income Fund was formed on October 22, 2010 and is domiciled in the United Stat', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CLMB', 'STOCK', 'Climb Global Solutions, Inc.', 'NGM', 'Technology', 'Electronics & Computer Distribution', 'Climb Global Solutions, Inc. is a value-added information technology (IT) distribution and solutions company. The Company primarily operates through its Distribution segment, which distributes emerging technologies to corporate resellers, value-added resellers (VARs), consultants and systems integrators worldwide under the name Climb Channel Solutions. This segment distributes technology products from software developers, software vendors or original equipment manufacturers (OEMs) to resellers and system integrators worldwide. The Company''s Solutions segment is a cloud solutions provider and value-added reseller of software, hardware, and services to customers worldwide under the name Grey Matter. Across both segments, the Company offers an extensive line of products from software vendors and tools for virtualization/cloud computing, security, networking, storage and infrastructure management, application lifecycle management and other technically sophisticated domains.', 'Eatontown, NJ, United States', 367);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BQ', 'STOCK', 'Boqii Holding Limited', 'ASE', 'Consumer Cyclical', 'Specialty Retail', 'Boqii Holding Ltd is a company engaged in operating an online pet-focused platform. The Company owns an online platform called Boqii through which it sells pet products under its brands Yoken, Mocare and two D-cat. The Company also provides pet products to pet stores and pet hospitals. The Company is involved in online marketing and information services business and place advertisements for brand owners. The Company also provide SaaS solution, which includes inventory management, membership management, price information and other services to offline stores. The Company mainly operates its business in domestic market.', 'Shanghai, , China', 158);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DAC', 'STOCK', 'Danaos Corporation', 'NYQ', 'Industrials', 'Marine Shipping', 'Danaos Corporation is a holding company and an international owner of containerships, chartering its vessels to a range of liner companies. The Company''s principal business is the acquisition and operation of vessels. The Company conducts its operations through the vessel owning companies, whose principal activity is the ownership and operation of containerships that are under the management of a related party of the company. The Company''s manager is Danaos Shipping Company Limited (Danaos Shipping). The Company has a fleet of over 50 containerships aggregating approximately 329,590 twenty-foot equivalent units (TEUs). Its containership fleet includes approximately 53 containerships deployed on time charters and approximately two containerships deployed on bareboat charter. Gemini Shipholdings Corporation (Gemini), a company beneficially owned by the Company, owns approximately four additional containerships of over 24,000 TEU aggregate capacity.', 'Piraeus, , Greece', 4);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVGN', 'STOCK', 'Evogene Ltd.', 'NCM', 'Healthcare', 'Biotechnology', 'Evogene Ltd is an Israel-based company, engaged in leveraging computational biology to design products for life-science-based industries including human health, agriculture, and industrial applications. Leveraging Big Data and Artificial Intelligence while incorporating a deep understanding of biology, Evogene established its technology, the Computational Predictive Biology (CPB) platform, to computationally design microbes, small molecules and genes as the core components for life-science products. Evogene holds a number of subsidiaries utilizing the CPB platform, for the development of human microbiome-based therapeutics, medical cannabis, ag-biologicals, ag-chemicals, seed traits and ag-solutions for castor oil production.', 'Rehovot, , Israel', 117);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DWAS', 'STOCK', 'Invesco DWA SmallCap Momentum ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 90% of its total assets in the securities that comprise the underlying index. The underlying index is composed of approximately 200 securities from an eligible universe of approximately 2,000 securities ranked 1,001 to 3,000 by market capitalization within the NASDAQ US Benchmark Index™.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNL', 'STOCK', 'Collective Mining Ltd.', 'ASE', 'Basic Materials', 'Gold', 'Collective Mining Ltd. is a Canada-based gold, silver, copper, and tungsten exploration company with projects in Caldas, Colombia. The Company is principally engaged in the acquisition, exploration and development of mineral properties located in Colombia. The Company has options to acquire 100% interest in two projects located directly within a mining camp with 10 fully permitted and operating mines. The Company''s flagship project, Guayabales, is anchored by the Apollo system, which hosts the largescale, bulk-tonnage, and high-grade gold-silver-copper-tungsten Apollo system. The Guayabales Project is located in the Middle Cauca belt in the Department of Caldas, Colombia. Its San Antonio project is located 4 kilometers (km) east of the Guayabales project, adjacent to the Panamerican highway. The San Antonio project is located approximately 80 km south of Medellin. It is situated in the Middle Cauca belt in the Department of Caldas, Colombia.', 'Toronto, ON, Canada', 102);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLFY', 'STOCK', 'Blue Foundry Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'Blue Foundry Bancorp is a holding company for Blue Foundry Bank (the Bank). The Bank is a chartered stock savings bank. The Bank''s principal business consists of originating one-to-four family residential, multifamily, and non-residential real estate mortgages, home equity loans and lines of credit, construction, and commercial and industrial loans in its principal market and surrounding areas. In addition, it often lends outside its branch network in more densely populated and metropolitan areas, adding diversification to its loan portfolio. It attracts retail deposits from the public in the areas surrounding its banking offices, through its borrowers, and through its online presence, offering a variety of deposit products. Its primary sources of funds are deposits, principal and interest payments on loans, securities, and borrowings. The Bank operates 20 full-service banking offices in Bergen, Essex, Hudson, Middlesex, Morris, Passaic, and Union counties in New Jersey.', 'Rutherford, NJ, United States', 184);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CSR', 'STOCK', 'Centerspace', 'NYQ', 'Real Estate', 'REIT - Residential', 'Centerspace is a real estate investment trust. The Company is focused on the ownership, management, acquisition, development, and redevelopment of apartment communities. It owns approximately 72 apartment communities consisting of 13,353 homes located in Colorado, Minnesota, Montana, Nebraska, North Dakota, South Dakota, and Utah. It conducts its business activities through a consolidated operating partnership, Centerspace, LP (the Operating Partnership), as well as through a number of other consolidated subsidiary entities. The Companys portfolio of apartment communities includes 71 France, Alps Park Apartments, Arcata Apartments, Ashland Apartment Homes, Avalon Cove Townhomes, Burgundy & Hillsboro, Canyon Lake Apartments, Castlerock Apartment Homes, Cottonwood Apartment Homes, Country Meadows Apartment Homes, Deer Ridge Apartment Homes, Grand Gateway Apartment Homes, Homestead Garden Apartments, Silver Springs Apartment Homes, Rimrock West Apartments, The Lydian and others.', 'Minot, ND, United States', 374);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BNTC', 'STOCK', 'Benitec Biopharma Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Benitec Biopharma Inc is a clinical-stage biotechnology company. The Company is focused on the advancement of novel genetic medicines. Its proprietary Silence and Replace deoxyribonucleic acid (DNA) -directed ribonucleic acid (RNA) interference platform combines RNA interference, or RNAi, with gene therapy to create medicines that simultaneously facilitate sustained silencing of disease-causing genes and concomitant delivery of wildtype replacement genes following a single administration of the therapeutic construct. The Company is developing Silence and Replace-based therapeutics (BB-301) for chronic and life-threatening human conditions including Oculopharyngeal Muscular Dystrophy (OPMD). BB-301 is an adeno-associated viral vector (AAV)-based gene therapy designed to silence the expression of disease-causing genes (to slow, or halt, the underlying mechanism of disease progression) and to simultaneously replace the mutant genes with normal, wildtype genes.', 'Hayward, CA, United States', 16);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBL', 'STOCK', 'DoubleLine Opportunistic Credit Fund', 'NYQ', 'Financial Services', 'Asset Management', 'DoubleLine Opportunistic Credit Fund is a close-ended fixed income mutual fund launched and managed by DoubleLine Capital LP. The fund invests in the fixed income markets. It invests in debt securities including residential and commercial mortgage-backed securities, asset-backed securities, U.S Government securities, corporate debt, international sovereign debt, and short-term investments.The fund benchmarks the performance of its portfolio against the Barclays Capital U.S. Aggregate Bond Index. DoubleLine Opportunistic Credit Fund was formed on July 22, 2011 and is domiciled in the United States.', 'Tampa, FL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBLA', 'STOCK', 'FB Bancorp, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'FB Bancorp, Inc. is the holding company for Fidelity Bank (the Bank). The Bank business consists primarily of taking deposits from the general public and investing those deposits, together with funds generated from operations, in one-to four-family residential real estate loans, commercial real estate loans, commercial loans, home equity loans and lines of credit, consumer loans and construction loans. The Bank operates through two segments: traditional banking and mortgage banking. Traditional banking operations consist primarily of interest earned on loans held for investment and securities and fees from deposit services. Mortgage banking operations consist principally of interest earned on mortgage loans held for sale, gains on sales of loans in the secondary mortgage market, and mortgage loan origination fee income. It offers various deposit accounts including negotiable orders of withdrawal, savings accounts, money market accounts, and certificate of deposit accounts.', 'New Orleans, LA, United States', 325);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKTX', 'STOCK', 'Akari Therapeutics, Plc', 'NCM', 'Healthcare', 'Biotechnology', 'Akari Therapeutics, Plc is a biotechnology company developing precision bifunctional antibody drug conjugates (ADC) for the treatment of cancer. Utilizing its ADC discovery platform, it generates bifunctional ADC candidates and optimizes them based on the desired application to target a range of cancers. Its lead candidate, AKTX-101, targets the TROP2 receptor on cancer cells, and with a proprietary linker, delivers its novel PH1 payload directly into the tumor. PH1 is a novel bifunctional payload that is designed to disrupt RNA splicing within cancer cells, inducing tumor-specific cell death while generating immunostimulatory effects and minimizing off-target toxicity. Its pipeline includes AKTX-101 and AKTX-102, a discovery-stage ADC that pairs PH1 with an undisclosed target antibody. It is pursuing research on two additional novel payloads, such as PH5 and PH6. It also has an ADC Platform for oncology and PHP-303 program for genetic disease, liver disease and inflammation.', 'Boston, MA, United States', 8);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AQB', 'STOCK', 'AquaBounty Technologies, Inc.', 'NCM', 'Consumer Defensive', 'Farm Products', 'AquaBounty Technologies, Inc. is a land-based aquaculture company. The Companys technology advances in fish breeding, genetics, and health and nutrition. It locates its land-based recirculating aquaculture system farms close to key consumption markets, which are designed to prevent disease and to include multiple levels of fish containment to protect wild fish populations. Its land-based farms utilize Recirculating Aquaculture Systems, which are designed to prevent disease and include multiple levels of fish containment designed to protect wild fish populations. Recirculating Aquaculture Systems facilities provide water treatment technology, including the use of ozone, salt treatment and ultraviolet radiation to kill potential bacterial, fungal, or viral pathogens which might enter the system.', 'Harvard, MA, United States', 4);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBUC', 'STOCK', 'Brookfield Business Corporation', 'NYQ', 'Financial Services', 'Asset Management', 'Brookfield Business Corporation operates as an investment vehicle to own and operate services and operations on a global basis and as an alternative vehicle for investors who prefer investing in the Companys operations through a corporate structure. Its services focus on providing end-to-end solutions to customers in both the public and private sector in each of the sectors served. Its services include a cloud-based, software-as-a-service (SaaS) solution to dealerships and original equipment manufacturers (OEMs) across automotive and related industries in the United States; operation of approximately 38 private hospitals in Australia; private sanitation services, including collection, treatment and distribution of water and wastewater to a broad range of residential and governmental customers in Brazil; and global construction services with a focus on large scale and complex landmark buildings and social infrastructure.', 'New York, NY, United States', NULL);\n
